class Memo(PluginBase):
    """
    功能：
    目前支持 文字、地图
    1.写入
        引用消息
        @机器人 记录 tag
    2.查询
        1.@机器人 查询列表
            return 所有tag列表
        2.@机器人 tag
            return tag下的所有详细信息
    3.删除（只有自己记录的才能删除）    
        1.@机器人 删除 message_id
            return 删除成功
    """
    description = "备忘录"
    author: str = "未知"
    version: str = "1.0.0"

    def __init__(self):
        super().__init__()
        # 媒体文件管理
        self.media_manager = MediaManager()
        # 永久存储
        self.permanent_storage = PermanentMediaStorage()

        # 读取配置文件
        with open("plugins/Memo/config.toml", "rb") as f:
            plugin_config = tomllib.load(f)

        with open("main_config.toml", "rb") as f:
            main_config = tomllib.load(f)

                    
        with open("resource/robot_stat.json", "r") as f:
            robot_stat = json.load(f)

        
        config = plugin_config["Memo"]
        main_config = main_config["XYBot"]

        self.wxid = robot_stat.get("wxid", None)
        self.enabled = config["enable"]
        self.command_set = config["command_set"]
        self.command_get = config["command_get"]
        self.command_list = config["command_list"]
        self.command_delete = config["command_delete"]

        self.timezone = main_config["timezone"]

        # 初始化数据库
        self.db = MemoDB()
    
    # MARK: - at消息处理
    @on_at_message
    async def handle_at(self, bot: WechatAPIClient, message: dict):
        """收到at消息时调用"""
        if not self.enabled:
            return
        
        # logger.info(f"收到文本消息: {message}")

        content = str(message["Content"]).strip()
        content_parts = re.split(r'[\s\u2005]+', content, 2)
        cmd = content_parts[1].strip() if len(content_parts) > 1 else ""
        tag = content_parts[2].strip() if len(content_parts) > 2 else ""

        if cmd in self.command_list:
            # 查所有tag
            await self.query_all(bot, message)
        elif cmd in self.command_get:
            # 查询tag列表
            await self.query_tag(bot, message, tag)
        elif cmd in self.command_delete:
            # 删除message
            await self.delete_message(bot, message, tag)
        else:
            return

    # MARK: - 引用消息
    @on_quote_message
    async def handle_quote(self, bot: WechatAPIClient, message: dict):
        """收到引用消息时调用"""
        if not self.enabled:
            return

        logger.info(f"收到引用消息: {message}")
        
        content = str(message["Content"]).strip()
        cmds = re.split(r'[\s\u2005]+', content, 2)
        cmd = cmds[1].strip() if len(cmds) > 1 else ""
        tag = cmds[2].strip() if len(cmds) > 2 else ""
        # 命令不符合
        if cmd not in self.command_set:
            return
        
        if not tag:
            await bot.send_at_message(message["FromWxid"], "\n请指定标签", [message["SenderWxid"]])
            return
        
        message_id = message.get("Quote", None).get("NewMsgId", None)
        wxid = message["SenderWxid"]
        chatroom_id = message["FromWxid"]
        quote_user_id = message.get("Quote", None).get("FromWxid", None)
        quote_user_name = message.get("Quote", None).get("Nickname", None)
        quote_msg_type = int(message.get("Quote", None).get("MsgType"))
        content = message.get("Quote", None).get("Content", None)
        create_time = datetime.now(tz=pytz.timezone(self.timezone))
        
        
        if not message_id:
            await bot.send_at_message(message["FromWxid"], "\n记录失败，不支持的消息类型", [message["SenderWxid"]])
            return

        # 记录到数据库
        is_ok = await self.db.add_memo(message_id, wxid, chatroom_id, quote_user_id, quote_user_name, create_time, tag, quote_msg_type)
        # 回复消息
        msg = "记录成功" if is_ok else "记录失败"
        logger.info(msg)
        if msg:
            await bot.send_at_message(message["FromWxid"], "\n" + msg, [message["SenderWxid"]])

    # MARK: - 图片消息
    @on_image_message
    async def handle_image(self, bot: WechatAPIClient, message: dict):
        """收到图片消息时调用"""
        if not self.enabled:
            return
        logger.info(f"收到图片消息: {message}")
        message_id = message.get("NewMsgId", "")
        image_data = message.get("Content", "")

        file_path = await self.media_manager.save_image(message_id, image_data=image_data)

        if file_path:
            logger.info("图片消息已处理")

    # MARK: - 语音消息
    @on_voice_message()
    async def handle_voice(self, bot: WechatAPIClient, message: dict):
        """收到语言消息"""
        if not self.enable:
            return
        message_id = message.get("NewMsgId", "")
        voice_data = message.get("Content", "")

        file_path = await self.media_manager.save_voice(message_id, voice_data=voice_data)

        if file_path:
            logger.info("语音消息已处理")


    # MARK: - 查询tag列表
    async def query_all(self, bot: WechatAPIClient, message: dict):
        """查询所有tag"""

        wxid = message["SenderWxid"]
        chatroom_id = message["FromWxid"]
        
        memos = self.db.query_all(wxid=wxid, chatroom_id=chatroom_id)
        reply = self._format_memo_list("所有", memos)
        
        logger.info(reply)
        if reply:
            await bot.send_at_message(message["FromWxid"], "\n" + reply, [message["SenderWxid"]])

    def _format_memo_list(self, title: str, memos: list) -> str:
        """格式化备忘录列表
        Args:
            title: 标题
            memos: 备忘录列表
        """
        if not memos:
            return f"没有找到{title}备忘录"
            
        reply = [
            f"📝 {title}备忘录：\n",
            "序号. 标签",
            "--------------------------------"
        ]
        
        # 提取所有标签并去重
        unique_tags = []
        for memo in memos:
            tag = memo.get("tag", "")
            if tag and tag not in unique_tags:
                unique_tags.append(tag)
        
        # 使用去重后的标签列表
        for i, tag in enumerate(unique_tags, 1):
            reply.append(f"{i}. {tag}")
            
        return "\n".join(reply)

    # MARK: - 查询tag
    async def query_tag(self, bot: WechatAPIClient, message: dict, tag: str):
        """查询具体的tag列表"""
        if not tag:
            await bot.send_at_message(message["FromWxid"], "\n请指定标签", [message["SenderWxid"]])
            return

        wxid = message["SenderWxid"]
        chatroom_id = message["FromWxid"]
        
        memos = self.db.query_tag(wxid=wxid, chatroom_id=chatroom_id, tag=tag)

        reply = self._format_tag_list(title=tag, memos=memos)

       
        if len(memos) > 0:
            reply = f"{reply}\n--------------------------------\n具体消息如下:"
            logger.info(reply)
            await bot.send_at_message(message["FromWxid"], "\n" + reply, [message["SenderWxid"]])
            await asyncio.sleep(1)
            await self._send_tag_message(bot, memos)
        else:
            await bot.send_at_message(message["FromWxid"], "\n" + reply, [message["SenderWxid"]])

    def _format_tag_list(self, title: str, memos: list) -> str:
        """格式化备忘录列表
        Args:
            memos: 备忘录列表
        """
        if not memos:
            return f"没有找到{title}备忘录"
            
        reply = [
            f"📝 {title}备忘录：\n",
            "序号. [消息id] [发送人] [记录时间]",
            "--------------------------------"
        ]
        
        # 循环
        for i, memo in enumerate(memos, 1):
            reply.append(f"{i}. [{memo.get('message_id', '空')}] [{memo.get('quote_user_name', '空')}] [{memo.get('create_time', '空')}]")
            
        return "\n".join(reply)
        

    async def _send_tag_message(self, bot: WechatAPIClient, messages: list):
        """发送消息"""
        for message in messages:
            msg_type = message.get("msg_type", "")

            if msg_type == 1: # 文本消息
                await self._send_text_message(bot, message)
            elif msg_type == 48: # 地图信息
                await self._send_map_message(bot, message)
            elif msg_type == 3: # 图片
                await self._send_image_message(bot, message)
            else:
                logger.info("未知的消息类型: {}", message)

            await asyncio.sleep(randint(1, 3))

    async def _send_text_message(self, bot: WechatAPIClient, message: list):
        await bot.send_text_message(message.get("chatroom_id"), message.get("content"))
    
    async def _send_map_message(self, bot: WechatAPIClient, message: list):
        content = message.get("content")
        # 处理XML格式：把fromusername=wxid 替换成bot的
        if content:
            import re
            content = re.sub(r'fromusername="[^"]+"', f'fromusername="{self.wxid}"', content)

        await bot.send_text_message(message.get("chatroom_id"), content, type=48)

    async def _send_image_message(self, bot: WechatAPIClient, message: list):
        image_path = await self.permanent_storage.get_image(message.get("message_id"))
        if image_path:
            await bot.send_image_message(message.get("chatroom_id"), image_path)
        else:
            logger.info(f"图片{message.get('message_id')}不存在")
        # await bot.send_cdn_img_msg(message.get("chatroom_id"), message.get("content"))

    # MARK: - 删除
    async def delete_message(self, bot: WechatAPIClient, message: dict, message_id: str):
        """通过消息id删除消息"""
        wxid = message["SenderWxid"]

        if not message_id:
            await bot.send_at_message(message["FromWxid"], "\n" + "请输入要删除的消息ID", [message["SenderWxid"]])
            return

        # 删除备忘录
        is_ok = await self.db.delete(wxid=wxid, message_ids=[message_id])

        if is_ok:
            reply = f"{message_id}备忘录删除成功"
        else:
            reply = f"{message_id}备忘录删除失败"
        
        logger.info(reply)

        if reply:
            await bot.send_at_message(message["FromWxid"], "\n" + reply, [message["SenderWxid"]])

